/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`%`*/ /*!50003 TRIGGER peakbooks.invoiceNoUpdates
BEFORE INSERT 
ON `invoices` FOR EACH ROW
BEGIN
	
	IF (NEW.estimate = 0 && NEW.sales_order_no = 0)
    THEN
      SET new.invoice_no = (select IFNULL(max(invoice_no), new.invoice_no) from peakbooks.invoices where created_by = new.created_by) + 1;
      SET new.estimate_no = 0;
      SET new.sales_order_no = 0;
      
    ELSEIF (NEW.sales_order_no = 0 && NEW.invoice_no = 0)
    THEN
     SET new.estimate_no = (select IFNULL(max(estimate_no), 0) from peakbooks.invoices where created_by = new.created_by) + 1;
     SET new.invoice_no = 0;
     SET new.sales_order_no = 0;
    ELSE
     SET new.sales_order_no = (select IFNULL(max(sales_order_no), 0) from peakbooks.invoices where created_by = new.created_by) + 1;
     SET new.invoice_no = 0;
     SET new.estimate_no = 0;
     END IF;
	
